import { useCookies } from 'react-cookie';
import { useNavigate } from "react-router-dom";
import { useState } from "react"

import { AiFillEye } from 'react-icons/ai';
import { AiFillEdit } from 'react-icons/ai';
import { AiFillDelete } from 'react-icons/ai';
import { MdLocationOn } from "react-icons/md";
import { MdFilterListAlt } from "react-icons/md";



export function SingleClient() {

    const [hover, setHover] = useState(false);

    function MouseOver(event) {
        setHover(true)
    }
    function MouseOut(event){
        setHover(false)
    }


      return (
          <tr class="candidates-list"  style={hover ? {...client, ...clientHover} : client} onMouseOver={MouseOver} onMouseOut={MouseOut}>
            <td class="title" style={title}>
              <div class="thumb" style={thumbnail}>
                <img class="img-fluid" src="https://bootdey.com/img/Content/avatar/avatar7.png" alt="" style={thumbnailImage}/>
              </div>
              <div class="candidate-list-details">
                <div class="candidate-list-info">
                  <div class="candidate-list-title">
                    <h5 class="mb-0" style={name}><a href="#">Brooke Kelly</a></h5>
                  </div>
                  <div class="candidate-list-option">
                    <ul class="list-unstyled" style={list}>
                      <li style={listItem}><MdFilterListAlt size="15"/>Information Technology</li>
                      <li style={listItem}><MdLocationOn size="15" />Rolling Meadows, IL 60008</li>
                    </ul>
                  </div>
                </div>
              </div>
            </td>
            <td class="candidate-list-favourite-time text-center" style={textField}>
              <span class="candidate-list-time order-1" style={textFieldText}>Shortlisted</span>
            </td>
            <td style={actions}>
              <ul class="list-unstyled mb-0 d-flex justify-content-end" style={actionList}>
                <li style={actionListItem}><a href="#" style={{"color": "#2d3b55"}}><AiFillEye size="25"/></a></li>
                <li style={actionListItem}><a href="#" style={{"color": "#60C656"}}><AiFillEdit size="25"/></a></li>
                <li style={actionListItem}><a href="#" style={{"color": "#D13C1D"}}><AiFillDelete size="25"/></a></li>
              </ul>
            </td>
          </tr>
      );
}


